import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div  id="quote-box">
          <p id="text">
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </div>
      </header>
    </div>
  );
}

export default App;
